import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { FormContainer, FormCard, FormTitle, FormInput, FormButton } from "../styles/formStyles";
import { MenuItem, Select } from "@mui/material";

function FormPage() {
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    location: "",
    type: "",
    propertyType: "",
    area: "",
    rooms: "",
    price: "",
    brand: "",
    model: "",
    year: "",
    mileage: "",
    serviceType: "",
    experience: "",
    cost: "",
    workSchedule: "",
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.name.trim() || !formData.description.trim() || !formData.location.trim() || !formData.type) {
      console.error("Заполните все обязательные поля!");
      return;
    }

    const requestData = {
      name: formData.name.trim(),
      description: formData.description.trim(),
      location: formData.location.trim(),
      type: formData.type,
    };

    if (formData.type === "Недвижимость") {
      requestData.propertyType = formData.propertyType || "Квартира";
      requestData.area = formData.area ? Number(formData.area) : undefined;
      requestData.rooms = formData.rooms ? Number(formData.rooms) : undefined;
      requestData.price = formData.price ? Number(formData.price) : undefined;
    } else if (formData.type === "Авто") {
      requestData.brand = formData.brand || "Не указано";
      requestData.model = formData.model || "Не указано";
      requestData.year = formData.year ? Number(formData.year) : undefined;
      requestData.mileage = formData.mileage ? Number(formData.mileage) : undefined;
    } else if (formData.type === "Услуги") {
      requestData.serviceType = formData.serviceType || "Не указано";
      requestData.experience = formData.experience ? Number(formData.experience) : undefined;
      requestData.cost = formData.cost ? Number(formData.cost) : undefined;
      requestData.workSchedule = formData.workSchedule || "Гибкий";
    }

    console.log("Отправляем данные:", requestData);

    fetch("/items", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(requestData),
    }).then(() => navigate("/list"));
  };

  return (
    <FormContainer>
      <FormCard>
        <FormTitle variant="h5">Разместить объявление</FormTitle>
        <form onSubmit={handleSubmit}>
          <FormInput label="Название" name="name" onChange={handleChange} required />
          <FormInput label="Описание" name="description" onChange={handleChange} required multiline rows={3} />
          <FormInput label="Локация" name="location" onChange={handleChange} required />

          <Select fullWidth name="type" value={formData.type} onChange={handleChange} required>
            <MenuItem value="">Выберите категорию</MenuItem>
            <MenuItem value="Недвижимость">Недвижимость</MenuItem>
            <MenuItem value="Авто">Авто</MenuItem>
            <MenuItem value="Услуги">Услуги</MenuItem>
          </Select>

          <FormButton type="submit" variant="contained">
            Добавить
          </FormButton>
        </form>
      </FormCard>
    </FormContainer>
  );
}

export default FormPage;
